import React from 'react';
import ReactDOM from 'react-dom';


const TodoList  = () => {
    const items = ['learn React 1','Work 2'];
    return (
        <ul>
            <li>{items[0]}</li>
            <li>{items[1]}</li>
        </ul>
    );
};

const AppHeader = () => {
    return <h1>My Todo List</h1>;
};
const SearchPanel = () => {
    const searchText = 'Type here to search';
    const searchStyle = {
        fontSize: '20px'
    };
    return <input 
    style = {searchStyle}
    placeholder = {searchText}   />;
};
 const el = (
    <div>
        <AppHeader/>
        <SearchPanel/>
        <TodoList />
    </div>
 );



ReactDOM.render(el, document.getElementById('root'));
